package dota2senate

import "testing"

func TestPredictPartyVictory(t *testing.T) {
	type test struct {
		name     string
		input    string
		expected string
	}
	tests := []test{
		{
			name:     "test 1",
			input:    "RD",
			expected: "Radiant",
		},
		{
			name:     "test 2",
			input:    "RDD",
			expected: "Dire",
		},
		{
			name:     "test 3",
			input:    "DDRRR",
			expected: "Dire",
		},
		{
			name:     "test 4",
			input:    "DRDRR",
			expected: "Dire",
		},
		{
			name: "test 5",
			input: "DDDDDDRDDRRDDRDRDDRDDDDDDRRDDDRRRDDDDRRDDRRDDRRRRRDRDDRRDDRRDDDDRRDRRRDDRRDDDDDRDDRDDD" +
				"",

			expected: "Dire",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			actual := predictPartyVictory(tt.input)
			if actual != tt.expected {
				t.Errorf("Actual: %s; Expected: %s", actual, tt.expected)
			}
		})
	}
}
